import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css'; // Import external CSS

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <Link to="/" className="navbar-link">Eventify</Link>
      </div>
      <div className="navbar-links">
        <Link to="/" className="navbar-link">Landing Page</Link>
        <Link to="/events" className="navbar-link">View All Events</Link>
        <div className="dropdown">
          <span className="dropdown-trigger">More</span>
          <div className="dropdown-content">
            <Link to="/manager-dashboard" className="dropdown-link">Manager Dashboard</Link>
            <Link to="/signup?role=manager" className="dropdown-link">Sign Up</Link>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
